              \ is rethrown, and no mapping is recorded.  The most\n common usage\
              \ is to construct a new object serving as an initial\n mapped value\
              \ or memoized result, as in:\n\n  <code>\n map.computeIfAbsent(key,\
              \ k -> new Value(f(k)));\n </code>\n\n Or to implement a multi-value\
              \ map, Map<K,Collection<V>>,\n supporting multiple values per key:\n\
